import {INSERT_CLIENT, GET_CLIENT_IDS} from "../action/editdata/aditDataActions";


export function reduceInsertClientResult(state = '', action){
    switch (action.type) {
        case INSERT_CLIENT:
            return action.result;
        default:
            return state;
    }
}

export function reduceGetClientIdsResult(state = [], action) {
    switch (action.type) {
        case GET_CLIENT_IDS:
            return action.result;
        default:
            return state;
    }
}
